/* Global Styles */
@import url("https://fonts.googleapis.com/css2?family=Montserrat:wght@100;200;300;400;500;600;700;800;900&display=swap");
@import url("https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@100;300;400;500;700;900&display=swap");

body {
  margin: 0;
  padding: 0;
  font-family: "Montserrat", "Noto Sans KR", sans-serif !important;
  color: #353535;
  background-color: #fff;
  font-size: 16px;
  height: 100%;
  display: flex;
  flex-direction: column;
}

a {
  text-decoration: none;
  color: #353535;
}

/*  */
main {
  flex: 1;
}

/*  */
header-component {
  width: 100%;
  z-index: 9;
}

/*  */
.header {
  min-height: 80px;
  background-color: transparent;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 10px 20px;
  transition: all 0.3s ease;
}

.header .inner {
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100%;
  max-width: 1200px;
  gap: 20px;
}

/*  */
.logo-wrapper {
  display: flex;
  align-items: center;
}

.logo {
  height: 40px; /*      */
  width: auto;
  object-fit: contain;
}

/*  */
.menu {
  display: flex;
  gap: 20px;
  justify-content: space-between;
  width: 100%;
  align-items: center;
}

.innerHeader {
  font-size: 1rem; /*   */
  color: #333;
  cursor: pointer;
  transition: all 0.3s ease;
  position: relative;
}

.innerHeader:hover {
  color: #ff9800;
  transform: scale(1.1);
}

/*   */
.hamburger-icon {
  display: none;
  cursor: pointer;
  flex-direction: column;
  gap: 5px;
}

.hamburger-icon span {
  display: block;
  width: 25px;
  height: 3px;
  background: #333;
}

.mobile-menu {
  display: none;
  position: absolute;
  top: 100%;
  right: 0;
  background: white;
  width: 100%;
  box-shadow: 0px 4px 6px rgba(0, 0, 0, 0.1);
  flex-direction: column;
  z-index: 999;
}

.mobile-menu.open {
  display: flex;
}

.mobile-menu-item {
  text-decoration: none;
  color: #333;
  padding: 10px 20px;
  border-bottom: 1px solid #ddd;
}

/*      */
.headerFixed {
  background-color: #fff;
  box-shadow: 0px 4px 6px rgba(0, 0, 0, 0.1);
  animation: slideDown 0.6s ease forwards;
}

.headerPlace {
  position: relative;
}

.headerPlaceFixed {
  position: fixed;
}

/*  */
@keyframes slideDown {
  from {
    transform: translateY(-100%);
    opacity: 0;
  }
  to {
    transform: translateY(0);
    opacity: 1;
  }
}

/*  */
footer-component {
  width: 100%;
  height: 100%;
  display: flex;
  z-index: 9;
  align-self: flex-end;
}

.footer {
  width: 100%;
  min-height: 80px;
  z-index: 9;
  transition: all 0.3s ease;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 12px;
  background-color: transparent;
  border-top: 1px solid #ddd;
  margin-top: 20px;
}

.footer-content {
  display: flex;
  justify-content: space-between;
  align-items: start;
  width: 100%;
  gap: 20px;
}

.footer-container {
  display: flex;
  flex-direction: column;
  gap: 10px;
}

.footer-menu {
  display: flex;
  flex-direction: column;
  font-size: 0.75rem;
}

/*  */
/* Slider Container */
.slider {
  position: relative;
  overflow: hidden;
  width: 100%;
  height: auto;
}

/* Slides Wrapper */
.slides {
  display: flex;
  transition: transform 0.5s ease;
  width: 100%; /* 3 slides */
  height: auto;
}

/* Slide Images */
.slides img {
  width: 100%;
  height: auto;
  object-fit: cover;
  flex-shrink: 0;
}

/* Navigation Buttons */
button.prev,
button.next {
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  background-color: transparent;
  border: none;
  color: #353535;
  font-size: 2rem;
  padding: 0.5rem 1rem;
  cursor: pointer;
  z-index: 2;
}

button.prev {
  left: 10px;
}

button.next {
  right: 10px;
}

/* Pagination */
.pagination {
  position: absolute;
  bottom: 10%;
  width: 100%;
  text-align: center;
}

.page-indicator {
  background: rgba(0, 0, 0, 0.5);
  color: white;
  padding: 0.5rem 1rem;
  border-radius: 5px;
  font-size: 1rem;
}

/*    */
.banner {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 20px;
  width: 100%;
  margin: 0 auto;
  padding: 20px;
  box-sizing: border-box;
  height: auto;
}

/*    */
.banner-container {
  position: relative;
  overflow: hidden;
  border-radius: 10px;
  cursor: pointer;
  height: auto;
}

/*   */
.banner-image {
  width: 100%;
  height: 100%;
  object-fit: cover;
  transition: transform 0.5s ease;
}

/*   */
.banner-text {
  position: absolute;
  width: 100%;

  top: 75%;
  left: 50%;
  transform: translate(-50%, -50%);
  text-align: center;
  color: white;
  text-shadow: 0px 4px 6px rgba(0, 0, 0, 0.5);
  z-index: 1;
  display: flex;
  flex-direction: column;
  justify-content: end;
  gap: 8px;
}

/*   */
.banner-container:hover .banner-image {
  transform: scale(1.1);
}

/*   */
.videoWrapper {
  padding: 0 20px;
  box-sizing: border-box;
  width: 100%;
  height: 100%;
}

.mainVideo {
  position: relative;
  width: 100%;
  max-width: 1920px;
  height: 0;
  padding-top: 56.25%;
  margin: 0 auto;
  border-radius: 10px;
  overflow: hidden;
}

.mainVideo iframe {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  max-width: 1920px;
  max-height: 1080px;
  border: 0;
}

/*   */
recommend-component {
  width: 100%;

  padding: 20px;
}
/* Swiper  */
.swiper {
  width: 100%;
  height: auto;
  max-width: 90%; /*    */
  margin: 0 auto; /*     */

  padding-bottom: 40px;
}

.swiper-text {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding-bottom: 20px;
  gap: 10px;
}

.swiper-text span:nth-child(1) {
  font-weight: 600;
  font-size: x-large;
}

.swiper-text span:nth-child(2) {
  color: #aaaaaa;
}

/* Swiper  */
.swiper-slide {
  display: flex;
  justify-content: center;
  align-items: center;
}

/*   */
.product {
  position: relative;
  overflow: hidden;
  transition: transform 0.3s ease;
}

/*   */
.product-overlay {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  background-color: rgba(255, 255, 255, 0.8);
  opacity: 0;
  transition: opacity 0.3s ease;
  gap: 20px;
}

.product:hover .product-overlay {
  opacity: 1;
  cursor: pointer;
}

/*   */
.buy-button {
  padding: 10px 20px;
  background-color: #ff9800;
  border: none;
  color: white;
  border-radius: 5px;
  cursor: pointer;
  transition: background-color 0.3s ease;
  width: 100%;
}

.buy-button:hover {
  background-color: #e68a00;
}

/*   */
.swiper-button-prev,
.swiper-button-next {
  color: #353535;
  display: flex;
  justify-content: center;
  align-items: center;
}

.swiper-button-prev::after,
.swiper-button-next::after {
  font-size: 2rem;
  margin-top: 40px;
}

/*  */
.swiper-pagination {
  bottom: 0 !important;
}

.swiper-pagination-bullet-active {
  background-color: #353535;
}

/*  */
.longBanner {
  display: flex;
  justify-content: center;
  align-items: center;
  box-sizing: border-box;
  position: relative;
  height: auto;
  width: 100%;
  padding: 20px 0;
}

.longBanner a {
  width: 100%;
}

.longBanner img {
  width: 100%;
}

.longBanner-text {
  position: absolute;
  z-index: 2;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  color: #f8f8f8;
  text-align: center;
  gap: 20px;
}

.longBanner-text span:nth-child(1) {
  font-size: 3rem;
  font-weight: 600;
}

.moreBtn {
  padding: 10px;
  border: none;
  background-color: #fff;
  cursor: pointer;
  display: flex;
  align-items: center;
  justify-content: space-between;
}

.moreBtn:hover {
  transition: all 0.3s ease;
  border: 1px solid #fff;
  color: #fff;
  background-color: transparent;
}

.reverse {
  background-color: #353535;
}

.reverse p {
  color: #fff;
}

.reverse i {
  color: #fff;
}

.reverse:hover {
  border: 1px solid #353535;
  color: #353535;
}

.reverse:hover p {
  color: #353535;
}

.reverse:hover i {
  color: #353535;
}

.moreBtn p {
  padding-right: 50px;
  margin: 0;
}

/*  */
/*   */
new-product-component {
  width: 100%;
  padding: 20px;
}
.Products {
  display: grid;
  grid-template-rows: repeat(auto-fill, minmax(0, 1fr)); /*    */
  grid-template-columns: repeat(5, 1fr); /*  5 */
  gap: 20px; /*    */
  justify-items: center; /*   */
  padding: 0 20px;
}

/*   */
.newProduct-info {
  padding: 10px 0;
  font-size: 12px;
  display: flex;
  flex-direction: column;
  align-items: start;
  gap: 5px;
}

.newTag {
  border: 1px solid #353535;
  color: #f8f8f8;
  background-color: #353535;
  padding: 0 2px;
}

.price {
  color: #ff99cc;
}

/*  :     */
.fade-in {
  opacity: 0;
  transform: translateY(30px);
  transition: opacity 0.6s ease-out, transform 0.6s ease-out;
}

/*      */
.fade-in-visible {
  opacity: 1;
  transform: translateY(0);
}

/*   */
best-product-component {
  width: 100%;
  padding: 20px;
}

/*   */
review-slider-component {
  width: 100%;
  padding: 20px;
}
/*   */
.review-slider {
  width: 100%;
  position: relative;
  overflow: hidden;

  max-width: 90%; /*    */
  margin: 0 auto; /*     */
}

/*  */
.review {
  display: flex;
  flex-direction: column;
  align-items: center;
  text-align: center;
  background-color: #fff;
  border-radius: 10px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  overflow: hidden; /*    */
  width: 100%; /*   swiper  */
  max-width: 250px; /*   */
  margin: 0 auto; /*   */
}

/*   */
.review-image-wrapper {
  width: 100%;
  height: auto;
  aspect-ratio: 1/1;
  overflow: hidden; /*       */
  margin-bottom: 10px;
  border-radius: 0 0 10px 10px;
}

.review-image {
  width: 100%;
  height: 100%;
  object-fit: cover;
  transition: transform 0.3s ease;
}

.review-image-wrapper:hover .review-image {
  transform: scale(1.1); /*     */
}

/*   */
.review-text {
  display: flex;
  flex-direction: column;
  gap: 10px;
  width: 90%; /*    */
  max-width: 220px; /*    */
  overflow: hidden;
  padding: 0 10px;
  box-sizing: border-box;
}
/*  */
.review-title {
  font-size: 1rem;
  font-weight: bold;
  color: #333;
  text-align: center;
  text-overflow: ellipsis; /*   */
  white-space: nowrap;
  overflow: hidden;
}

/*  */
.review-content {
  font-size: 0.85rem;
  color: #666;
  width: 100%;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis; /*   */
}

/*    */
.review-name-line {
  width: 90%;
  display: flex;
  align-items: center;
  justify-content: center;
  height: 1px;
  background-color: #f8f8f8;
  margin: 10px 0;
}

.review-name {
  font-size: 0.9rem;
  color: #333;
  width: 100%;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis; /*   */
}

.review-stars {
  font-size: 1rem;
  padding-bottom: 10px;
  color: #f5c518; /*   */
}

/*   */
.swiper-button-prev,
.swiper-button-next {
  color: #353535;
  width: 30px;
  height: 30px;
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 1rem;
  z-index: 2;
}

.swiper-button-prev::after,
.swiper-button-next::after {
  margin-top: 0;
  margin-bottom: 60px;
}

/*  */
instagram-component {
  width: 100%;
  padding: 20px 0;
}
/*   */
.instagram-grid {
  display: grid;
  grid-template-columns: repeat(5, 1fr); /* 5  */
  grid-auto-rows: 1fr; /*   */
  gap: 10px; /*    */
  padding: 10px;
}

/*   */
.instagram-item {
  position: relative;
  width: 100%;
  aspect-ratio: 1 / 1; /*   */
  overflow: hidden;
  border-radius: 10px;
  transition: transform 0.3s ease;
  cursor: pointer;
}

.instagram-item:hover {
  transform: scale(1.05); /*     */
}

/*  */
.instagram-image {
  width: 100%;
  height: 100%;
  object-fit: cover;
  transition: transform 0.3s ease;
}

/*  */
.instagram-overlay {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(0, 0, 0, 0.5); /*   */
  opacity: 0; /*   */
  display: flex;
  justify-content: center;
  align-items: center;
  transition: opacity 0.3s ease;
}

.instagram-item:hover .instagram-overlay {
  opacity: 1; /*     */
}

/*  */
.fa-instagram {
  color: #fff;
  font-size: 2rem;
}

.instagram-item:hover .instagram-icon {
  transform: scale(1.2); /*     */
}

/*  */
/*   */
.widget {
  position: fixed;
  top: 50%; /*   */
  right: 20px; /*   */
  transform: translateY(-50%);
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 10px; /*    */
  background-color: #f8f8f8;
  padding: 8px;
  border-radius: 10px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  z-index: 1000;
}

/*   */
.widget-button {
  width: 30px;
  height: 30px;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: transparent;
  border: 1px solid #ddd;
  border-radius: 50%;
  cursor: pointer;
  transition: background-color 0.3s ease, transform 0.3s ease;
}

.widget-button i {
  color: #353535;
  font-size: 1.25rem;
}

/*    */
.widget-button:hover {
  background-color: #f0f0f0;
  transform: scale(1.1);
}

/*   */
ad-banner-component {
  width: 100%;
  z-index: 10;
}

/*    */
.ad-banner-container {
  width: 100%;
  height: auto;
  background-color: #f8f9fa;
  border-bottom: 1px solid #ddd;
  display: flex;
  align-items: center; /*   */
  top: 0;
  overflow: hidden;
  z-index: 1000;
}

/*   */
.ad-banner-close {
  position: absolute;
  right: 10px;
  top: 20px;
  transform: translateY(-50%);
  font-size: 1rem;
  cursor: pointer;
  color: #555;
  padding: 5px 10px;
  background: none;
  border: none;
  font-weight: bold;
  user-select: none;
  transition: color 0.3s ease;
  z-index: 10;
}

.ad-banner-close:hover {
  color: #000;
}

/* Swiper */
.ad-banner-swiper {
  width: 100%;
  height: 40px;
  display: flex; /* Flexbox  */
  align-items: center; /*     */
  overflow: hidden;
  padding: 0;
}

/* Swiper Wrapper */
.ad-banner-swiper .swiper-wrapper {
  display: flex;
}

/* Swiper  */
.ad-banner-slide {
  display: flex;
  justify-content: center; /*    */
  align-items: center; /*    */
  height: 100%; /*     */
  font-size: 0.9rem;
  color: #333;
  font-weight: bold;
  text-align: center; /*    */
  white-space: nowrap; /*    */
}

.user {
  display: block;
}

/*   */
@media (max-width: 980px) {
  .innerHeader {
    font-size: 12px;
  }
}
@media (max-width: 768px) {
  body {
    font-size: 10px;
  }

  .menu {
    display: none;
  }

  .hamburger-icon {
    display: flex;
  }

  /*   */
  recommend-component {
    padding: 10px;
  }
  /* Swiper  */
  .swiper {
    padding-bottom: 20px;
  }

  .swiper-text {
    gap: 5px;
  }

  .swiper-text span:nth-child(1) {
    font-size: large;
  }

  /*   */
  .buy-button {
    padding: 2.5px 5px;
    font-size: 8px;
  }

  .swiper-button-prev::after,
  .swiper-button-next::after {
    font-size: 12px;
    margin-top: 0px;
    margin-bottom: 110px;
  }

  /*  */
  .swiper-pagination {
    bottom: 0 !important;
  }

  .swiper-pagination-bullet-active {
    background-color: #353535;
  }

  /*   */
  .banner-text {
    top: 50%;
    gap: 4px;
  }
  .banner-text span:nth-child(2) {
    font-size: 8px;
  }

  /*  */
  /*   */
  new-product-component {
    width: 100%;
    padding: 20px;
  }
  .Products {
    display: grid;
    grid-template-rows: repeat(auto-fill, minmax(0, 1fr)); /*    */
    grid-template-columns: repeat(3, 1fr); /*  3 */
    gap: 10px; /*    */
    justify-items: center; /*   */
    padding: 0 10px;
  }

  /*  */

  .longBanner-text {
    gap: 2.5px;
  }

  .longBanner-text span:nth-child(1) {
    font-size: 26px;
  }

  .moreBtn {
    justify-content: center;
    padding: 2px 4px;
  }

  .moreBtn p {
    padding-right: 0;
  }

  .moreBtn i {
    display: none;
  }

  /*  */

  .header .inner {
    gap: 5px;
    justify-content: space-between;
  }

  /*  */
  .menu {
    gap: 5px;
  }

  .innerHeader {
    font-size: 1rem;
  }

  .user-icon {
    display: none;
  }
}
